import ReactDom from 'react-dom'

// stateless functional component
// always return JSX

// const Greeting = () => {
//   return React.createElement('h1',{},'hello world')
// }

function BookList() {
  return (
    <section>
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
    </section>
  )
}

const Book = () => {
  return <article>
    <Image></Image>
    <Title />
    <Author />
  </article>
}

const Image = () => {
  return <img src='https://images-na.ssl-images-amazon.com/images/I/81kv0vHJ0QL._AC_UL240_SR240,240_.jpg' alt=''/>
}

const Title = () => <h1>TensorFlow book</h1>

const Author = () => <h4>John Reed</h4>

ReactDom.render(<BookList />, document.getElementById('root'))
